(3, 'PRISM-ELITE (English Language Initiative for Training Experts)\r\nThe Vision\r\nResearch is the key to development. This is an era of specialization. But even a well-trained researcher in every field â€“ Pure Science, Life Science, Medicine, Pharmacy, Engineering and Technology or even disciplines like Economics, Commerce, Sociology, Arts is required to put his work on paper/print/electronic media. The only common thread uniting all the experts is English as a medium of communication. The rate of success increases with the improvement in communication skills.    \r\nCurrently, English has linguistic supremacy over other languages. The international academia is a blend of hard working nationalities particularly from Asian sub-continent for whom English is a second or third language for instance Chinese, Japanese, Indian, Russian, Korean origin researcher. Each subject expert may not be automatically equally skillful in the contemporary reigning medium of expression, English. A void was felt by researchers as there was no specialized help available. PRISM-ELITE was created with a vision to mentor the language aspect of the researcher.\r\nMoreover,interdisciplinary approach to research gives better results and globalization is the new code to excel. A life scientist requires as much help of a statistician to analyze data as a statistician needs various kinds of data to put his own formulae/methods to be tested. How will the two communicate? Similarly, a German Sociologist might require the help of a Korean nutrition expert. A Japanese physicist and a Sri Lankan mathematician help each other, a Pakistani chemist might seek help from a Nigerian pharmacist and vice versa. An Indian Psychologist and an Iranian Neuroscientist along with a Chinese Statistician might work wonders for the humanity. A French artist might need some help in Russian history, to prepare digital designs using Indian graphics expert. Each expert has a diverse ethnic Non-English speaking background for, instance Chinese start learning English in college.  But, today they need to converse and put their work in English. As a result non â€“native speakers of language donâ€™t understand fine nuances and grammar.PRISM-ELITE is an English Language Initiative catering to the needs of research community.\r\nThe current generation of professionals is breaking cultural and lingual boundaries to excel using English as a common medium of communication.\r\nPRISM-ELITEis an effort to re-acquaint busy professionals who have mediocre English language expertise and limited time with an up-to-date knowledge of English Grammar.PRISM-ELITE is a free community service to hone the English Skills of an expert so as to improve his/her chances of glory. Join us, take our lessons and compare the difference.\r\nPRISM-ELITE wishes all the researchers good luck in the game called Career Advancement.\r\nPRISM-ELITE has been established to mentor researchers for enhancement of their English linguistic prowess. \r\nIn order to help you further Prism offers free of cost weekly English language exercises to improve your language skills on the go.Our well charted-out exercises conducted on a weekly basis will improve your ability to communicate and hence deliver.  You may subscribe to this free community service or else you may log on to our website www.prism-elite.com. In order to subscribe the free service please click the link.\r\n\r\nTest your English Language Skills\r\nImprove your vocabulary\r\nCommon errors in English Language\r\nInteractive games\r\n\r\nPRISM EDITING SERVICES, editing service for the researchers by the researchers.\r\nTHE VISION\r\nPRISM EDITING SERVICES is an editing service by a group of researchers. Researchers for whom English is a second language face it challenging to publish a paper in a journal of repute. Professional editing is required to display the meticulously performed study on a visible reputed platform in order to harness success.In an era of extensive cuts on budgeting of education and research,expensive editing makes it difficult for an average investigator with modest grant to get the painstakingly written manuscript undergo expert checking. The founders of Prism Editing Services, themselves being researchers, felt an insidersâ€™ need for a professional editing service by people who understand the subject as well as the language aspect of the manuscript so that the central idea of the paper is not lost or subdued while improving it.\r\nWe intend to elevate the status of the document by recruiting experts in the subject with thorough command over English Language at an easily affordable rate.\r\nTHE INTEGRITY\r\nWe understand the significance of your unpublished Manuscript and hence we assure total confidentiality of your work. We would love to have your valuable feedbacks and reviews. However, in the absence of your willingness we will never disclose your identity.\r\nTHE MOTIVATION\r\nResearchers all over the world are under constant pressure and scrutiny. They are best minds in their respective areas. Recent years have seen cut throat competition in publication world particularly the   scientific sphere. The investigator is mired with listed journals, impact factors, citations, h-index, i10â€“index, research gate score etc. Therefore, we designed PRISM EDITING SERVICES to help our colleagues. \r\nOUR SERVICES\r\nWe at PRISM, intend to help in manuscript preparationin the following categories. The interested candidates may choose from among the following levels according to their requirement. \r\nWe offer basic proofreading for spellings, grammar and punctuationthrough EDITING LEVEL I. Some academics have difficulty in writing proper English as they learnt it as their second or third language; they may consider opting for EDITING LEVEL II.Some scholars want to get their manuscriptschecked by experts in their field before sending to any journal along with basic proofreading.EDITING LEVEL IIImight help them.\r\nWe are giving an introductory discount on word count limit up to 3500 on each category.\r\nAs a bonus we offer to check and help you write an error-free cover letter, error-free response letter to the editor.\r\nWe offer unlimited check for 365 days for repetitive checking rounds if the journal requests revision. \r\nOUR SERVICES\r\nEDITING LEVEL I:Itwill take care ofspellings, grammar and punctuation.\r\nEDITING LEVEL II: Itwill cover spellings, grammar and punctuation besides elevating the overall lingual standard of the Manuscript. Experts will fine-tune sentence structuresfor clarity in the argument besides avoiding duplication.\r\nEDITING LEVEL III:Itwill take care of the technical and Linguistic quality of the manuscript by focusing on the structure of the sentence and relevant terminologies according to subject. Our experts will give you tips on how to write coherently and improve presentation.\r\nEDITING LEVEL IV:Itwill cater to the needs of people who intend to get their thesis/dissertation checked before submission. We offer two levels, charges will depend on word count. Please send a pdf file of your work to get a quote for editing.\r\n(a)Basic proof reading for thesis/dissertationfor spellings, grammar and punctuation checking.\r\n(b)Basic proof reading IV (a) besides polishing the overall lingual standard of the Manuscript.\r\nWHO CAN BENEFIT FROM PRISM?\r\nInitially the service was intended for academicians to help them with Research articles, Review articles, Letters to the editor, Short Communications, Medical reports, Case studies etc.However, on popular demand, we will help in editing book chapters, Theses, Dissertations, abstracts for conference/resume/cover letters/small write-ups for popular magazines or laboratory brochures. \r\n\r\nSystematic Infrastructure Management for Professional Research\r\nPRISM\r\nHOW IT WORKS\r\nWE prefer double spaced MS word file. By using Track change feature we can easily show what kind of changes are required and the author can instantly understand the corrections with the dialogue.\r\nSAMPLE\r\nPDF files can also be edited at some extra cost.Our expert will send a separate word file to indicate the corrections.\r\n\r\n\r\n\r\n\r\nGrammar\r\nOur experts will be checking the manuscript for correct use of articles,tenses, appropriate prepositionsand proper forms of other parts of speech.\r\nSpellings\r\nOur specialists will be checking manuscript for spelling-mistakes particularly with reference to British or American English.\r\nPunctuation\r\nOur experts will help in incorporatingtheproper use of comma,full stop, hyphen, colon, semi-colon and apostrophe in the manuscript.\r\nLanguage Check\r\nOur experts will advise on appropriate use of sentence structure, better word substitution to enhance the quality. We will give suggestions on use of abbreviations, use of capital letters, numbering style, headings and sub headings besides scrutinizing for British and American English.\r\n\r\nSubject Mentors\r\nOur editors are well-qualified professionals holding advanced degrees like Ph. Ds/M. Ds/M.Tech. in their respective fields. They willmentor the author by guiding with appropriate use of subject specific terminologies, techniques, titles like correct use of subject-specific variables, symbols, equations,abbreviations of units of measurements, scientific names and nomenclatures besides checking of graphical abstracts.\r\nData consistency check\r\nThe authors will be guided for consistency in figures/ tables/graphs. Besides, we will examine each figure for appropriate reference in text and supporting legend.\r\nCoherence Check \r\nThe professionals will guide the authors for any gap in reasoning between sentences and subsequent paragraphs.We will help you analyze the clarity of sentence appropriate to the heading.\r\nReasoning check\r\nTheauthors will be channeled towards logical arguments, expressions and conclusions in the manuscript. We will also help you ensure reasoning that your inference seems natural.\r\nPresentation Face-lifting Tips\r\nWe will try to help you prepare crisp, eye-catching manuscriptspowered by the latest techniques in writing. \r\nSubstance Enrichment\r\nOur team will assist you in substance enrichment by inspecting the content for clarity and elimination of any duplicate data, sentences and jargon unless necessary.\r\nReference check for journal citation style\r\nWe will help you cross check references for citation style in the text and list according to the rules of the journal.\r\nCover Letter Support\r\nWe will cross check your cover letter for any mistakes including salutation, grammar and punctuation mentioning appropriate subject.\r\nWord Reduction up to 22%\r\nOur experts can help you reduce word count by 22% so that the same information may be provided within the word limit set by target journals. \r\nRevision Support for 365 Days\r\nWe offer revision support to the author for a year, in case the journal remains the same and the article processing (review-comments-revision) cycle takes more than a year we extend the support till the manuscript is published. In case the author wants to change the journal for the same manuscript within a year we offer discount rates.\r\nRevision Response Letter support \r\nWe offer to help you craft a linguistically appropriate formal letter in response to the reviewerâ€™s comments.\r\n \r\n\r\n\r\n\r\n\r\nPRISM EDITING SERVICESis a branch of PRISM-ELITE, a one stop solution for problems faced by non-native English language speakers in research, for the researchers by the researchers.\r\n\r\nThe Problem\r\nIn order to create a positive effect, one aspires to have an error-free communication. The aspirant who wantsto make his/her work visible at the international level, necessarily need to be proficient in the current linguistic format.Effective use of language is necessary to express/persuade/convince the listener or reader.Your valuable theory/idea, whatever it may be important, if it is full of mistakes or repeated words make an undesirable effect.\r\nThe Goal\r\nEvery professional/academician/researcherseeks to make an impact. Developing competence after due recognition of oneâ€™s own area of weakness is a symbol of wisdom. If aptitude in English is hampering ones rate of success, itâ€™s better to improve the coveted skill.Better communication techniques are instrumental for the success of a dedicated individual. Improved expertise in language leads to enhanced exchange of ideas at verbal or scriptedformats, leading to a successful career.\r\n\r\n\r\nThe Target audience\r\nA number of researchers learnt English as a second or third language; therefore, they fall out while interacting with native speakers.It has been observed that they are uncomfortable while giving presentations or feel awkward answering queries or during interviews. The highly intelligent,talented and hard-working professionals sometimes trail behind those with better expressions or command of the English language.  A demanding career leaves little time to take out grammar books or take classes to acquire much required language skills.\r\n'),
